function App() {

  return (
    <Router>
      <Switch>
      <React.Fragment>
          <Route exact path="/login" component={Login}/>
          <Route exact path={["/register"]} component={Register}/>
          <Route exact path={["/", "/baligya"]} component={ProductList}/>
          <Route exact path={["/dashboard"]} component={AdminDashboard}/>
      </React.Fragment>
      </Switch>
    </Router>
  );
 }

export default App;
